import './App.css';
import './CSS/alert.css';
import './CSS/styles.css';
import './CSS/prontos.css';
import './CSS/proximos.css';

import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom'
import { useState, useEffect } from 'react'

import Admin from './components/admin'
import Proximo from './components/proximos'
import Pronto from './components/prontos'


function App() {

  const [itens, setItens] = useState([])

  function getData() {
    fetch('http://localhost:3000/fila/list', { method: "GET" })
      .then(response => response.json())
      .then(data => setItens(data))
  }

  useEffect(() => {
    getData()
  }, [])

  return (
    <div className="App">
      <body>
        <div id="customAlert" class="modal">
          <div class="modal-content">
            <span id="closeBtn" class="close">&times;</span>
            <p id="alert-frase">Informe sua senha:</p>
            <input type="text" id="numericCode" placeholder="C√≥digo num√©rico" />
            <button id="cancelBtn" class="cancel-btn">Cancelar</button>
            <button id="confirmBtn">Confirmar</button>
          </div>
        </div>
        <div class="container-principal">
          <Router>
            <div>
              <header>
                <nav className="navigation">
                  <img className="seta" src="../public/img/arrow.png" alt="voltar" />
                  <Link to="/admin">
                    <h1 id="logo">FILA</h1>
                  </Link>
                  <h1 id="rest">Restaurante</h1>
                </nav>
              </header>
              <Routes>
                <Route path="/admin" element={<Admin />} />
              </Routes>
            </div>
          </Router>

          <div class="container-prontos">
            <p class="titulo-prontos">Prontos</p>
            <div class="chamando">
              <p>100</p>
              <span>5 minutos atr√°s</span>
            </div>
            <div class="prontos-scroll">
              <ul class="prontos">
                {
                  itens.map(item => {
                    if(item.pronto == false){
                      return <Pronto item={item} />
                    }
                  })
                }
              </ul>
            </div>
          </div>
        </div>

        <div class="container-proximos">
          <p class="titulo-proximos">Proximos</p>
          <ul class="proximo">
            {
              itens.map(item => {
                return <Proximo item={item} />
              })
            }
          </ul>
        </div>
      </body>
      <script src="/script.js"></script>
    </div>
  );
}

export default App;
